import React from "react";

function Card ({titulo, informacion, image, fecha, fuente}) {
    return(
        <div className="div-card">
            <h1>{titulo}</h1>
            <p>{informacion}</p>
            <img src={image} alt="Imagen"/>
            <h3>{fecha}</h3>
            <h2>{fuente}</h2>
        </div>
    )
}

export default Card
